As I get ready to board my next trip I can't help but think about how amazing my trip to Kuwait and Iraq was. I need to send a huge thank you first of all to Brian Lee for being so freakin awesome and taking such good care of us and to @prosportsmvp and @armedforcesent for making it possible.  I still can't believe we were lucky enough to get to experience that. I miss you guys @blatner12 @hawks13 @zcarchedi ❤️ to everyone who is still out there 🙌🏽 thank you!@honeyb_fit @pager0army 
@14_mylife @ashbash1155 @_spirit_animal_ #lifefittour #iraq #bdsc #kuwait #usarmy #supportourtroops #airborne #airassault #operationinherentresolve #travellife .
Off to Punta Cana ✈️🌎

Thank you so much General  Volesky for bringing us out to Baghdad to visit the troops and train with them. It was such an honor to be there and shake hands with those who are out there fighting the war on terror.  I will never forget this experience and I hope I get to do it again sometime. For everyone serving, veterans and anyone who has enlisted, THANK YOU! 🙌🏽
