I know that yesterday I said that riding in a C-130 Hercules was the coolest thing I had ever done but I'm pretty sure that riding the jumpseat of a CH-47D Chinook just beat that 😎🚁 .
@gatorzeyewear , your sunglasses are hands down the best especially out here. 🙌🏽 the sun blazing here and it's kind of nice to know they won't fall down when you are looking down from a Huey Helicopter😳. .
